import React from "react";
import Head from "next/head";
import { withRedux } from "../lib/with-redux-store";
import Navbar from "./Navbar";

function Layout({ children }) {
  return (
    <div>
      <Head>
        <title>Developers Today</title>
      </Head>

      <Navbar />
      {children}
    </div>
  );
}

export default withRedux(Layout);
